                imageContainer.appendChild(resultDiv);

                shuffleArray(locations);
                locations.forEach((location, index) => {
                    const radio = document.createElement('input');
                    radio.type = 'radio';
                    radio.name = 'guess';
                    radio.id = `guess-${index}`;
                    radio.value = location.name;
                    radio.classList.add('radio-button');
                    radio.style.left = `${location.x * 100}%`;
                    radio.style.top = `${location.y * 100}%`;
                    imageContainer.appendChild(radio);
                });
            }
            function hideRadials() {
                const radials = document.querySelectorAll('.radio-button');
                radials.forEach(radial => radial.style.display = 'none');
            }
            function selectRandomLocation() {
                if (remainingLocations.length === 0) {
                    document.getElementById("prompt").textContent = "Ἀριστα! πάσας τὰς λέξεις ἐμαντεύσω.";
                    hideRadials()
                    return;
                }
                const index = Math.floor(Math.random() * remainingLocations.length);
                currentLocation = remainingLocations[index];
                document.getElementById("prompt").textContent = `Εὑρὲ τὸν τόπον. ποῦ ἐστιν: ${currentLocation.name}?`;
            }

            function checkGuess(event) {
                if (event.target.type === "radio") {
                    const guess = event.target.value;
                    const resultElement = document.getElementById("result");
                    if (guess === currentLocation.name) {
                        resultElement.textContent = "ὀρθῶς!";
                        resultElement.style.color = "green";
                        guessCount += 1;
                        if (guessCount >= 3) {
                            remainingLocations = remainingLocations.filter(loc => loc.name !== currentLocation.name);
                            guessCount = 0;
                        }
                        setTimeout(() => {
                            resultElement.textContent = "";
                            createGameBoard();
                            selectRandomLocation();
                        }, 1500);
                    } else {
                        resultElement.textContent = "οὔ, πειρῶ αὖθις...";
                        resultElement.style.color = "red";
                    }
                }
            }

            document.getElementById('revealButton').addEventListener('click', function() {
                const obfuscatedText = document.getElementById('obfuscatedText');
                obfuscatedText.textContent = 'ὁ βοῦς τὴν ἅμαξαν ἕλκει';
                obfuscatedText.classList.remove('blurred-text');
                obfuscatedText.classList.add('revealed-text');
            });

            createGameBoard();
            selectRandomLocation();
            document.getElementById("imageContainer").addEventListener("click", checkGuess);
        </script>
    </body>
